import React, { useState } from "react";
import { api } from "./api";

export default function LoginPage({ onLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);

  const submit = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      const res = await api.post("/users/login", {
        username: username.trim(),
        password: password.trim(),
      });
      onLogin(res.data.token);
    } catch {
      window.alert("Invalid username/password.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        display: "grid",
        placeItems: "center",
        padding: 16,
        fontFamily: "Inter, Arial, sans-serif",
        background: "linear-gradient(180deg,#f6f8ff,#ffffff)",
      }}
    >
      <div
        className="card"
        style={{
          width: "100%",
          maxWidth: 420,
          padding: 18,
          borderRadius: 18,
        }}
      >
        <div style={{ display: "flex", alignItems: "center", gap: 10, marginBottom: 14 }}>
          <div
            style={{
              width: 44,
              height: 44,
              borderRadius: 12,
              background: "linear-gradient(135deg,#6366f1,#22c55e)",
              display: "grid",
              placeItems: "center",
              color: "white",
              fontWeight: 800,
            }}
          >
            SC
          </div>
          <div>
            <p style={{ margin: 0, fontSize: 20, fontWeight: 900, color: "#111827" }}>
              Welcome back
            </p>
            <p style={{ margin: "4px 0 0 0", color: "#6b7280", fontSize: 13 }}>
              Login to continue
            </p>
          </div>
        </div>

        <form onSubmit={submit}>
          <div style={{ marginBottom: 12 }}>
            <div style={{ fontSize: 12, fontWeight: 800, color: "#374151", marginBottom: 6 }}>
              Username
            </div>
            <input
              placeholder="Enter username"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              style={{
                width: "100%",
                padding: 12,
                borderRadius: 12,
                border: "1px solid #e5e7eb",
                outline: "none",
                fontSize: 14,
              }}
            />
          </div>

          <div style={{ marginBottom: 12 }}>
            <div style={{ fontSize: 12, fontWeight: 800, color: "#374151", marginBottom: 6 }}>
              Password
            </div>
            <input
              placeholder="Enter password"
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              style={{
                width: "100%",
                padding: 12,
                borderRadius: 12,
                border: "1px solid #e5e7eb",
                outline: "none",
                fontSize: 14,
              }}
            />
            <div style={{ marginTop: 6, color: "#6b7280", fontSize: 12 }}>
              Tip: avoid trailing spaces
            </div>
          </div>

          <button
            disabled={!username.trim() || !password.trim() || loading}
            style={{
              width: "100%",
              border: "none",
              borderRadius: 12,
              padding: 12,
              fontWeight: 900,
              cursor: !username.trim() || !password.trim() || loading ? "not-allowed" : "pointer",
              color: "white",
              background: "linear-gradient(135deg,#6366f1,#8b5cf6)",
              opacity: !username.trim() || !password.trim() || loading ? 0.65 : 1,
            }}
          >
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>

        <div
          style={{
            marginTop: 12,
            fontSize: 12,
            color: "#6b7280",
            background: "#f9fafb",
            border: "1px solid #e5e7eb",
            padding: 10,
            borderRadius: 12,
            lineHeight: 1.4,
          }}
        >
          Signup is via backend endpoint <b>POST /users</b>.
        </div>
      </div>
    </div>
  );
}
